input_symbol varchar(45),
input_obv_evaluation_run_id int)
BEGIN

   -- Declare variables used just for cursor and loop control
  DECLARE no_more_rows int;
  DECLARE num_rows INT DEFAULT 0;

    DECLARE loop_counter_one_day INT DEFAULT 0;

    DECLARE loop_counter_three_day INT DEFAULT 0;


      DECLARE var_curr_signal int DEFAULT 0;


