    DECLARE var_three_day_success_counter INT DEFAULT 0;

    DECLARE var_one_day_success_confidence float DEFAULT 0;

    DECLARE var_three_day_success_confidence float DEFAULT 0;






    DECLARE obv_backtest_data CURSOR FOR
    SELECT DISTINCT
        DATE_FORMAT(curr_date,'%Y-%m-%d'),curr_signal
